import createReactComponent from "../createReactComponent";
import defaultAttributes from "../defaultAttributes";
var PauseCircle = createReactComponent("PauseCircle", ["svg", defaultAttributes, [["circle", {
  cx: "12",
  cy: "12",
  r: "10",
  key: "14id60"
}], ["line", {
  x1: "10",
  y1: "15",
  x2: "10",
  y2: "9",
  key: "fqtey5"
}], ["line", {
  x1: "14",
  y1: "15",
  x2: "14",
  y2: "9",
  key: "1o0kt7"
}]]]);
export default PauseCircle;
